import ListItem from "./ListItem/ListItem";
import Card from "../Card/Card";
import './List.css'

function List(props){

    return(
    <Card className="expenses">
        <ListItem raraty={props.array[0].raraty} hex={props.array[0].hex}/>
        <ListItem raraty={props.array[1].raraty} hex={props.array[1].hex}/>
        <ListItem raraty={props.array[2].raraty} hex={props.array[2].hex}/>
    </Card>
    );
}

export default List;
